import './Board.css';
import RobotInGame from "./RobotInGame";

export default function Board() {
    const board = [];

    const xnumber = 10;
    const ynumber = 10;

    board.push(<RobotInGame x={xnumber} y={ynumber}/>);


    return <div id="Board">{board}</div>;
}
